import React from "react";

import classes from "./ContainerRespaldo.module.css";
import Croquis from './Croquis/Croquis';

const Respaldo = (props) => {
  let ancho=null
  let altura=null
  if(props.respaldo.medida.ancho && props.respaldo.medida.altura){
    ancho=<span className={classes.ancho}>{props.respaldo.medida.ancho.toFixed(2)} m.</span>
    altura=<span className={classes.altura}>{props.respaldo.medida.altura.toFixed(2)} m.</span>
  }
  return (
      <div className={classes.containerRespaldo}>
        {altura}
        <div className={classes.respaldo}>
          <Croquis respaldo={props.respaldo}/>
        </div>
        {ancho}
      </div>
  );
};

export default Respaldo;
